message:
Resumo do dia do Bolsonaro: 
*A Super Live de 22 horas foi um mega sucesso retumbante e furou diversas bolhas;
*A Entrevista com o Ben Shapiro foi um sucesso internacional, pois o Bolsonaro se apresentou aqui de uma forma muito diferente de como a mídia o apresenta. Mostrou ser um líder extremamente diplomático e com uma excelente agenda de politica internacional;
*O debate que virou sabatina esta sendo mais um sucesso. O Bolsonaro esta se mantendo calmo, as perguntas estao ótimas e ele esta tendo tempo para esclarecer todas as duvidas dos eleitores indecisos.
O resto? O resto e' distracao...
